$templateCache.put("app/modules/stylus/views/typography.html","<div class=\"page\">\n\n    <header class=\"page-header grey darken-3 z-depth-2\">\n      <div class=\"container\">\n        <div class=\"row\">\n\n          <div class=\"col s12\">\n            <h1 class=\"page-title white-text darken-4\">\n              <strong class=\"pink-text text-accent-1\">Typography</strong></h1></div>\n\n          <div class=\'col s12\'>\n            <p class=\" caption\">\n              The standard font Material Design uses is Roboto. We have included the font files with our framework.\n\n              </p></div>\n\n          </div></div></header>\n\n    <section class=\"section\">\n      <div class=\'container page-content\'>\n\n        <section class=\"col s12\">\n          <div class=\"card white\">\n            <article class=\"card-content\">\n\n              <h2 class=\"thin\">Roboto 2.0</h2>\n              <p>\n                The standard font Material Design uses is Roboto. We have included the font files with our framework.\n              </p>\n              <div class=\"row center\">\n                <p class=\"col s12 m4\">\n                    We bundle our framework with the latest iteration of Roboto Google has released. It comes with 5 different font weights you can use: 200, 300, 400, 500, 600.\n                  <br>\n                  <br>\n                      Here is an image from Google\'s Roboto Specimen document displaying the different font weights.\n                </p>\n                <img src=\"content/images/style_typography_roboto1.png\" class=\"col ms12 m8\" alt=\"\" />\n              </div>\n              <pre><code no-escape hljs>\n\n&lt;mz-col s=12 m=2>\n    &lt;p class=\"z-depth-1\">z-depth-1&lt;/p>\n&lt;/mz-col>\n&lt;mz-col s=12 m=2>\n    &lt;p class=\"z-depth-2\">z-depth-2&lt;/p>\n&lt;/mz-col>\n&lt;mz-col s=12 m=2>\n    &lt;p class=\"z-depth-3\">z-depth-3&lt;/p>\n&lt;/mz-col>\n&lt;mz-col s=12 m=2>\n    &lt;p class=\"z-depth-4\">z-depth-4&lt;/p>\n&lt;/mz-col>\n&lt;mz-col s=12 m=2>\n    &lt;p class=\"z-depth-5\">z-depth-5&lt;/p>\n&lt;/mz-col>\n\n              </code></pre>\n\n              </article></div></section>\n\n\n        <section class=\"col s12\">\n          <div class=\"card white\">\n            <article class=\"card-content\">\n\n              <h2 class=\"thin\">Headers</h2>\n              <p>We provide some basic styling on header tags. In the example on the right, you can see the difference in sizes between the 6 header tags.</p>\n              <div class=\"card-panel\">\n                <h1>Heading h1</h1>\n                <h2>Heading h2</h2>\n                <h3>Heading h3</h3>\n                <h4>Heading h4</h4>\n                <h5>Heading h5</h5>\n                <h6>Heading h6</h6>\n              </div>\n\n              </article></div></section>\n\n\n        <section class=\"col s12\">\n          <div class=\"card white\">\n            <article class=\"card-content\">\n\n              <h2 class=\"header\">Blockquotes</h2>\n              <p>\n                Blockquotes are mainly used to give emphasis to a quote or citation. You can also use these for some extra text hierarchy and emphasis.\n                </p>\n              <blockquote>\n                This is an example quotation that uses the blockquote tag.\n                <br>Here is another line to make it look bigger.\n              </blockquote>\n              <pre><code no-escape hljs>\n\n&lt;blockquote>\n    This is an example quotation that uses the blockquote tag.\n&lt;/blockquote>\n\n              </code></pre>\n              </article></div></section>\n\n\n        <section class=\"col s12\">\n          <div class=\"card white\">\n            <article class=\"card-content\">\n\n              <h2 class=\"header\">Flow Text</h2>\n              <a flow-toggle class=\"btn waves-effect waves-light white-text\">Toggle flow-text</a>\n              <div class=\"card-panel flow-text-demo\">\n                  <p class=\"flow-text\">\n                  One common flaw we\'ve seen in many frameworks is a lack of support for truly responsive text. While elements on the page resize fluidly, text still resizes on a fixed basis. To ameliorate this problem, for text heavy pages, we\'ve created a class that fluidly scales text size and line-height to optimize readability for the user. Line length stays between 45-80 characters and line height scales to be larger on smaller screens.</p>\n                  <br>\n                  <br>\n                  <p class=\"flow-text\">To see Flow Text in action, slowly resize your browser and watch the size of this text body change! Use the button above to toggle off/on flow-text to see the difference!</p>\n              </div>\n              <pre><code no-escape hljs>\n\n&lt;p flow-text>I am Flow Text&lt;/p>\n\n              </code></pre>\n              </article></div></section>\n\n\n\n      </div></section>\n\n</div>\n");
